The strategy of RuntimeFilter should be placed in `RuntimeFilterGenerator`, not `Planner`, which will destroy the previous structure.

Three suggestions~:
1. Before `generateFilters`, use a Map to store whether all Tuples of PlanTree have conjuncts;

2. This strategy should be placed in `RuntimeFilter create` to filter `srcExpr`, similar to the one selected in the picture; the `removeUselessRuntimeFilters` Func is no longer needed;

3. Modify the name of `ENABLE_STAR_SCHEMA_RUNTIME_FILTER_POLICY`. This policy is not directly related to star schema, for example: `ENABLE_REMOVE_NO_CONJUNCTS_RUNTIME_FILTER`. Or add enough comments to explain that this strategy is beneficial in most star schemas, otherwise it is misleading;

